import React from "react";
import { DashPopularWrap } from "../../styles/components/Dashboard/DashPopularStyle";

export default function DashPopular() {
  return (
    <DashPopularWrap>
      <img />
      <div>Name:Meluha</div>
      <div>Author:Amish Tripathi</div>
      <div>Publication: </div>
    </DashPopularWrap>
  );
}
